import React from 'react';
import {
    TextField,
    Button
} from '@material-ui/core';

const HomePage = () => {
return (
    <>
    <h3>Cisco Webex Teams </h3>
    <h1>Seamlessly take your classroom virtual.</h1>
    <p>
    Lorem ipsum dolor sit amet, consectetur adipiscing elit.
    Suspendisse molestie in felis id tincidunt. Ut suscipit vestibulum sagittis.
    Nam ultrices porta sapien, sed tincidunt urna egestas id.
    Sed finibus felis eget turpis posuere, sed dapibus dui pretium.
    </p>
    <TextField id="outlined-basic" label="Enter you work Email address" variant="outlined" />
    <Button color="primary">Hello World</Button>;
    </>
);
}

export default HomePage;
